import {ADD_FILE, SET_FORM_DATA_VALUE} from "./actionTypes";

const initialState = {
    exel: false,
    file: null,
    errorType: null,
    uploadText: '',
    formData: {
        departOne : {
            sku: '',
            name: '',
            points: '',
            measurement: ''
        },
        departTwo : {
            classifiers: '',
            suppliers: '',
            barcode: '',
            description: '',
        },
    },
};

export default function importReducer(state = initialState, action) {

    switch (action.type) {

        case SET_FORM_DATA_VALUE:
            return {
                ...state,
                formData: action.formData
            }
        case ADD_FILE:
            return {
                ...state,
                [action.name]: action.value
            }
        default: return state;
    }
}
